import React from 'react';

function createStars(rating) {
  let stars = '';
  for (let i = 0; i < rating; i++) {
    stars += '<img src="/images/star.png" alt="Star" style={{width:"25px"}}/>';
  }
  return stars;
}

export default function Movie({ movie, handleDelete }) {
  const rating = Number(movie.rating) || 0;

  return (
    <li>
      {movie.title}
      <div dangerouslySetInnerHTML={{ __html: createStars(rating) }} />
      <img 
        src="/images/delete.png" 
        alt="Delete movie" 
        className="delete-movie-icon" 
        onClick={() => handleDelete(movie.title)} 
        style={{width:"25px"}}
      />
    </li>
  );
}
